  \"resilience-indicator-summaries-and-resilience-scores-cnmi-excel-database\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Maps of relative classifications (low to
  high) for six resilience indicators and two anthropogenic stressors and a map of
  final relative resilience scores for 78 sites in the Commonwealth of the Northern
  Mariana Islands. The six resilience indicators are: bleaching resistance, coral
  diversity, coral recruitment, herbivore biomass, macroalgae cover and temperature
  variability. The two anthropogenic stressors are fishing access and nutrients and
  sediments. The resilience score map compares sites across all four of the surveyed
  islands: Saipan, Tinian, Aguijan, and Rota.\",\n\t\"license_title\": null,\n\t\"extras\":
